// VGA display example from https://github.com/Tapendra-195/Armv7/tree/main
//let's compile
//let's run it.
//let's look at pixel buffer.
//bye...
// 320x240, 1024 bytes/row, 2 bytes per pixel: DE1-SoC
.equ WIDTH, 320
.equ HEIGHT, 240
.equ LOG2_BYTES_PER_ROW, 10
.equ LOG2_BYTES_PER_PIXEL, 1

.equ PIXBUF, 0xc8000000		// Pixel buffer

.global _start
_start:
	ldr sp, =0x800000	// Initial stack pointer
    mov r8,#2	// index
	
	
Loop:
	cmp r8,#0
	ldreq r0,=list
	cmp r8,#1
	ldreq r0,=list1
	cmp r8,#2
	ldreq r0,=list2
	moveq r8,#0
	addne r8,r8,#1 
        bl FillColour		// Fill screen with a colour
	                        // NOTE The b instruction will branch. It jumps to another instruction, and there is no return expected. 
			        // The Link Register (LR) is not touched.
	                        // The bl instruction will branch, but also link. 
			        // LR will be loaded with the address of the instruction after BL in memory, not the instruction executed after BL. 
	                        // It will then be possible to return from the branch using LR.
       
        b Loop

// r0: colour address
FillColour:
	push {r8, r9, r10, lr}	// Save some registers
    
    mov r10, r0
    // Two loops to draw each pixel
	mov r9,#0
	mov r8,#0
    1:	mov r8,#0	
        2:  mov r0, r8
            mov r1, r9
            ldr r2, [r10]
            bl WritePixel		// Draw one pixel
			add r10,r10,#4
            add r8,r8,#1
			cmp r8,#320
            bne 2b
		add r9,r9,#1
        cmp r9,#240
        bne 1b                   // bne branch not equal 
	                         // Labels "xb" and "xf", where "x" is a number are a smart extension to the GNU assembly.
			         // It branches to the first found label "x" searching "forward" for "f" or "backward" for "b".
	                         // That means that in your first listing using "1b" as a target will search for "1" BEFORE the instruction that uses it. 
			         // If you used "1f" it would  search for "1" AFTER the instruction that uses it, 

	pop {r8, r9, r10, lr}
    bx lr



WritePixel:
    lsl r1, r1, #LOG2_BYTES_PER_ROW
    lsl r0, r0, #LOG2_BYTES_PER_PIXEL
    add r1, r0
    ldr r0, =PIXBUF
    
    strh r2, [r0,r1] //This is where pixel is written 
    bx lr
	
